YUI.add("treeview-templates",function(e,t){var n=e.Template.Micro;e.namespace("TreeView").Templates={children:n.compile('<ul class="<%= data.classNames.children %>"></ul>'),node:n.compile('<li id="<%= data.node.id %>" class="<%= data.classNames.node %>"><div class="<%= data.classNames.row %>" data-node-id="<%= data.node.id %>"><span class="<%= data.classNames.indicator %>"><s></s></span><span class="<%= data.classNames.label %>"></span></div></li>')}},"@VERSION@",{requires:["template-micro"]})